import React from 'react';
import './App.css';
import HomePage from './pages/homepage/homepage.components';
import { Route, Switch } from 'react-router-dom';

const HatsPage =() => (
  <div>
    <h1>
      HatsPage
    </h1>
  </div>
)

function App() {
  return (
    <div >
      <Switch>
      <Route exact path='/' component={HomePage} />
      <Route  path='/hats' component={HatsPage} />
      </Switch>
    </div>
  );
}

export default App;
